function Footer() {

    return(
    <footer>
        <nav class="container-xxl felx-wrap flex-md-nowrap" aria-label="Main navigation">

            <a href="https://www.linkedin.com/in/justinhanson1/" target="_blank">Linked In</a>
            <a href="https://github.com/hansonjw">GitHub</a>
            <a href="https://twitter.com/hansonjw">Twitter</a>

        </nav>
    </footer>
    )

}

export default Footer;
